	private static void buildfrequencys (int[] samples, int sampleRate) {
		
		int pozitiveCounter = 0;
		int negativeCounter = 0;
		int skipCounter = 0;
		int totalSampleCounter = 0;
		int frequencysMap[] = new int[200];
		int mapCounter = 0;
		int limit = 10;
		int amplitudeBuffer = 0 ;;
		int amplitudeMap[] = new int[200];
		
		for(int i = 1; i < samples.length; i++) {

			totalSampleCounter++;
			amplitudeBuffer += Math.abs(samples[i]);
			
			if(samples[i] > 0) {
				
				if(pozitiveCounter < limit) 
					pozitiveCounter++;
				
				if(pozitiveCounter == limit && negativeCounter > 0 && negativeCounter < limit )
					negativeCounter--;
								
				if(pozitiveCounter >= limit && negativeCounter >= limit) {
					
					amplitudeMap[mapCounter] = amplitudeBuffer / totalSampleCounter;				
					frequencysMap[mapCounter++] = sampleRate / (totalSampleCounter - limit - skipCounter*2+1) ;
					System.out.println("buildfrequencys Added!: "+ frequencysMap[mapCounter-1] + ", i: "+(i - limit - skipCounter*2+1) + ", skipCounter: "+skipCounter);
					
					totalSampleCounter= limit + skipCounter;
					amplitudeBuffer = 0;
					pozitiveCounter = 0;
					skipCounter = 0;
					negativeCounter = 0;

				}
			}
			
			if(samples[i] < 0) {
				
				if(pozitiveCounter > 0 && pozitiveCounter < limit) {

					pozitiveCounter--;
					skipCounter++;
				}
				
				if(negativeCounter < limit) 	
					negativeCounter++;		
				
				if(negativeCounter == limit) {
					pozitiveCounter=0;
					skipCounter = 0;
				}
			}
		
			System.out.println("buildfrequencys i: "+i +", samples[i]: "+samples[i] +", pozitiveCounter: "+pozitiveCounter+", negativeCounter: "+negativeCounter 
					+ ", skipCounter: "+skipCounter + ", totalSampleCounter: "+totalSampleCounter);
		}
		
		System.out.println(""+Arrays.toString(amplitudeMap));
		System.out.println(""+Arrays.toString(frequencysMap));
	};
	
